A_RSRC}\" -o \"$MASTER_DMG\"\n  hdiutil flatten \"$MASTER_DMG\"\nfi\n\napp=`which seticon || echo 'non'`\nif [ -x $app ] ; then \n\tseticon \"$WC_DMG\" \"$MASTER_DMG\"\nelse\n\techo warning Missing stuff\nfi\n\n";
